function GetDateFormat(date) {
  var month = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"];

  var selected_month = month[date.getMonth()];
  month = month.length > 1 ? month : '0' + month;
  var day = date.getDate().toString();
  day = day.length > 1 ? day : '0' + day;

  if (day === 1) {
    return_string = "1st, " + selected_month + " " + date.getFullYear();
  } else if (day === 2) {
    return_string = "2nd, " + selected_month + " " + date.getFullYear();
  } else if (day === 3) {
    return_string = "3rd, " + selected_month + " " + date.getFullYear();
  } else {
    return_string = day + "th, " + selected_month + " " + date.getFullYear();
  }

  return return_string;
}


